  "translationLines": [
    {
      "lineNumber": 162231,
      "originalJapaneseLine": "　ランス殿」",
      "translatedEnglishLine": "Lord Rance."
    },
    {
      "lineNumber": 162232,
      "originalJapaneseLine": "「ありがとぉ〜、らんすぅ〜」",
      "translatedEnglishLine": "\"Thank youuu, Ranceee~\""
    },
    {
      "lineNumber": 162233,
      "originalJapaneseLine": "アスカはニコニコ顔で退室していった。",
      "translatedEnglishLine": "Asuka left the room with a smiling face."
    },
    {
      "lineNumber": 162234,
      "originalJapaneseLine": "ランス達が魔物の支配地を慎重に進んでいく。",
      "translatedEnglishLine": "Rance and his party carefully proceeded through the monster's territory."
    },
    {
      "lineNumber": 162235,
      "originalJapaneseLine": "「ちっ、なーんか魔物との",
      "translatedEnglishLine": "\"Tch, it feels like there are more and more fights with monsters."
    },
    {
      "lineNumber": 162236,
      "originalJapaneseLine": "　戦闘が多くなってきたな」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 162237,
      "originalJapaneseLine": "「そうですねぇ……",
      "translatedEnglishLine": "\"That's right..."
    },
    {
      "lineNumber": 162238,
      "originalJapaneseLine": "　やっぱりここは魔物の支配地なんですね……」",
      "translatedEnglishLine": "As expected, this is monster territory...\""
    },
    {
      "lineNumber": 162239,
      "originalJapaneseLine": "「元はリーザスの領土なのに、",
      "translatedEnglishLine": "\"Originally it was Leazas's territory,"
    },
    {
      "lineNumber": 162240,
      "originalJapaneseLine": "　魔物が我が物顔で歩いてやがるとはな」",
      "translatedEnglishLine": "but monsters are walking around as if it’s theirs.\""
    },
    {
      "lineNumber": 162241,
      "originalJapaneseLine": "「大体、前回来たときに、",
      "translatedEnglishLine": "\"Basically, last time we came,"
    },
    {
      "lineNumber": 162242,
      "originalJapaneseLine": "　俺様が魔人を倒して一気に押し返したのに、",
      "translatedEnglishLine": "I defeated the Demon Lord and pushed them back all at once,"
    },
    {
      "lineNumber": 162243,
      "originalJapaneseLine": "　また押されてるとはリーザスも情けない」",
      "translatedEnglishLine": "and yet Leazas is being pushed back again, how pathetic.\""
    },
    {
      "lineNumber": 162244,
      "originalJapaneseLine": "「お恥ずかしい限りですじゃ……」",
      "translatedEnglishLine": "\"It's utterly embarrassing...\""
    },
    {
      "lineNumber": 162245,
      "originalJapaneseLine": "「仕方ありません。",
      "translatedEnglishLine": "\"It can't be helped."
    },
    {
      "lineNumber": 162246,
      "originalJapaneseLine": "　兵力に差がありすぎますから」",
      "translatedEnglishLine": "There is just too much difference in troop strength.\""
    },
    {
      "lineNumber": 162247,
      "originalJapaneseLine": "「これでも善戦している方かと」",
      "translatedEnglishLine": "\"Still, I think we're putting up a good fight.\""
    },
    {
      "lineNumber": 162248,
      "originalJapaneseLine": "「ふん、負けてるんじゃ、",
      "translatedEnglishLine": "\"Hmph, if you're losing,"
    },
    {
      "lineNumber": 162249,
      "originalJapaneseLine": "　善戦もへったくれもない」",
      "translatedEnglishLine": "there's nothing good about 'putting up a good fight.'\""
    },
    {
      "lineNumber": 162250,
      "originalJapaneseLine": "「それに、魔人の存在もあります。",
      "translatedEnglishLine": "\"Moreover, there's the presence of the Demon Lord."
    },
    {
      "lineNumber": 162251,
      "originalJapaneseLine": "　魔人がいる限り、人類側に勝ち目はありません」",
      "translatedEnglishLine": "As long as the Demon Lord exists, humanity has no chance of winning.\""
    },
    {
      "lineNumber": 162252,
      "originalJapaneseLine": "「俺様が魔人を倒すしかないってわけだ」",
      "translatedEnglishLine": "\"That means only I can defeat the Demon Lord.\""
    },
    {
      "lineNumber": 162253,
      "originalJapaneseLine": "「はい、その通りかと」",
      "translatedEnglishLine": "\"Yes, that’s exactly right.\""
    },
    {
      "lineNumber": 162254,
      "originalJapaneseLine": "そのとき、ランス達は農作業をしている",
      "translatedEnglishLine": "At that moment, Rance and the others passed"
    },
    {
      "lineNumber": 162255,
      "originalJapaneseLine": "数人の村人らしき者達とすれ違った。",
      "translatedEnglishLine": "by a few villagers who were working in the fields."
    },
    {
      "lineNumber": 162256,
      "originalJapaneseLine": "村人達はランス達を軍人と判断したようで、",
      "translatedEnglishLine": "The villagers seemed to have judged Rance and his party as soldiers,"
    },
    {
      "lineNumber": 162257,
      "originalJapaneseLine": "腰を低くして頭をぺっこりと下げている。",
      "translatedEnglishLine": "and they lowered their posture and bowed their heads deeply."
    },
    {
      "lineNumber": 162258,
      "originalJapaneseLine": "「ふーん、この辺って人が暮らしてるのか」",
      "translatedEnglishLine": "\"Hmm, people actually live around here?\""
    },
    {
      "lineNumber": 162259,
      "originalJapaneseLine": "「ええ、魔軍の支配地域とは言っても、",
      "translatedEnglishLine": "\"Yes, even though this is monster army territory,"
    },
    {
      "lineNumber": 162260,
      "originalJapaneseLine": "　住民全てが逃げられるわけではないのですじゃ」",
      "translatedEnglishLine": "not all the residents can escape, you see.\""
    },
    {
      "lineNumber": 162261,
      "originalJapaneseLine": "「一部は親戚などを頼り疎開しておりますが、",
      "translatedEnglishLine": "\"Some have evacuated relying on relatives and such,"
    },
    {
      "lineNumber": 162262,
      "originalJapaneseLine": "　ほとんどの者はまだ街や村に残っております」",
      "translatedEnglishLine": "but most still remain in the towns and villages.\""
    },
    {
      "lineNumber": 162263,
      "originalJapaneseLine": "「よく殺されんな」",
      "translatedEnglishLine": "\"It's surprising they aren’t killed often.\""
    },
    {
      "lineNumber": 162264,
      "originalJapaneseLine": "「ええ、魔軍もリーザス軍との戦いで、",
      "translatedEnglishLine": "\"Yes, the monster army is also engaged in fighting the Leazas forces,"
    },
    {
      "lineNumber": 162265,
      "originalJapaneseLine": "　街などを攻撃する余裕まではまだないようですな」",
      "translatedEnglishLine": "so it seems they don't yet have the capacity to attack towns and the like.\""
    },
    {
      "lineNumber": 162266,
      "originalJapaneseLine": "「……ですが、ここはあくまでも魔軍の支配地域。",
      "translatedEnglishLine": "\"...However, this is, after all, monster army territory."
    },
    {
      "lineNumber": 162267,
      "originalJapaneseLine": "　いつ魔物が街や村を襲いだすか……」",
      "translatedEnglishLine": "There's always a possibility that monsters might suddenly attack towns or villages...\""
    },
    {
      "lineNumber": 162268,
      "originalJapaneseLine": "「出来るだけ避難、疎開をするようにとは",
      "translatedEnglishLine": "\"We are calling for everyone to evacuate and relocate as much as possible,"
    },
    {
      "lineNumber": 162269,
      "originalJapaneseLine": "　こちらも呼びかけてはいますが……」",
      "translatedEnglishLine": "but...\""
    },
    {
      "lineNumber": 162270,
      "originalJapaneseLine": "「誰もが出来るわけではないですからのう……」",
      "translatedEnglishLine": "\"Not everyone can do that after all...\""
    },
    {
      "lineNumber": 162271,
      "originalJapaneseLine": "「ふーん」",
      "translatedEnglishLine": "\"Hmm.\""
    },
    {
      "lineNumber": 162272,
      "originalJapaneseLine": "「そういえばランス殿、",
      "translatedEnglishLine": "\"By the way, Lord Rance,"
    },
    {
      "lineNumber": 162273,
      "originalJapaneseLine": "　この先にあるカクテル迷宮はご存じですかな？」",
      "translatedEnglishLine": "are you familiar with the Cocktail Labyrinth ahead?\""
    },
    {
      "lineNumber": 162274,
      "originalJapaneseLine": "「知らん。",
      "translatedEnglishLine": "\"I don’t know it."
    },
    {
      "lineNumber": 162275,
      "originalJapaneseLine": "　なんだそれ」",
      "translatedEnglishLine": "What’s that?\""
    },
    {
      "lineNumber": 162276,
      "originalJapaneseLine": "「三ヶ月に一度、確実に幸福きゃんきゃんが",
      "translatedEnglishLine": "\"Once every three months, there's a guaranteed Happy Kyankyan"
    },
    {
      "lineNumber": 162277,
      "originalJapaneseLine": "　発生するポイントがあるのですじゃ」",
      "translatedEnglishLine": "point that occurs there."
    },
    {
      "lineNumber": 162278,
      "originalJapaneseLine": "「普段はそれ狙いの冒険者で溢れ、",
      "translatedEnglishLine": "\"Normally that place is overflowing with adventurers aiming for it,"
    },
    {
      "lineNumber": 162279,
      "originalJapaneseLine": "　競争率の高さ故とても戦えないのですが、",
      "translatedEnglishLine": "and due to the high competition, it’s very hard to fight there,"
    },
    {
      "lineNumber": 162280,
      "originalJapaneseLine": "　今はなにしろ戦時中",
      "translatedEnglishLine": "but now, after all, it’s wartime."
    }
  ]
}

